import React from "react";
import styles from "./FieldSet.module.scss";
import { TextField } from "@material-ui/core";
import TextArea from "./Input/TextArea";
const FieldSet = () => {
  return (
    <div className={styles.form}>
      <TextArea textField={{
        variant: 'outlined',
        label: 'Tiêu Đề',
        placeholder: 'Tiêu đề trang',
        multiline: 'multiline',
      }}/>
      <div className={styles.row}>
        <TextField label='Nội Dung 1' placeholder='Nội dung đồng thời là tiêu đề ở trang chính' multiline variant='outlined' />
      </div>
      <TextArea textField={{
        label: 'Nội Dung 1',
        placeholder: 'Nội dung trong trang',
        multiline: 'multiline',
        variant: 'outlined'
      }}/>
      <TextArea textField={{
        variant: 'outlined',
        label: 'Nội Dung 2',
        placeholder: 'Nội dung trong trang',
        multiline: 'multiline'
      }}/>
    </div>
  );
};

export default FieldSet;
